import React, {Component} from "react"

function Item(props){

	const styles= {
		padding:"0px",
		margin:"0px",
		backgroundColor:"red"}


	return(
			<div style={styles}>
				<h3>{props.num.id}. </h3>
				<p>{props.num.task}</p>
				<hr></hr>
			</div>
	);
}

export default Item
